import React, {useEffect} from 'react';
import ScriptTag from 'react-script-tag';
import{BrowserRouter as Router} from 'react-router-dom'
import {DataProvider} from './GlobalState'
import Header from './components/headers/Header'
import MainPages from './components/mainpages/Pages'
function App() {
  return (
    <DataProvider>
      <Router>
        <Header/>
        <ScriptTag type="text/javascript" src="https://code.jquery.com/jquery-3.3.1.min.js"/>
        <ScriptTag type="text/javascript" src="https://mnat261999.github.io/js/vendor/modernizr-3.5.0.min.js"/>
        <ScriptTag type="text/javascript" src="https://mnat261999.github.io/js/popper.min.js"/>
        <ScriptTag type="text/javascript" src="https://mnat261999.github.io/js/bootstrap.min.js"/>
        <ScriptTag type="text/javascript" src="https://mnat261999.github.io/js/plugins.js"/>
        <ScriptTag type="text/javascript" src="https://mnat261999.github.io/js/active.js"/>
      </Router>
    </DataProvider>
  );
}

export default App;
